void lenetSynthMatlab::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"inputImg_address0\" :  \"" << inputImg_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"inputImg_ce0\" :  \"" << inputImg_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"inputImg_q0\" :  \"" << inputImg_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"netScores_address0\" :  \"" << netScores_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"netScores_ce0\" :  \"" << netScores_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"netScores_we0\" :  \"" << netScores_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"netScores_d0\" :  \"" << netScores_d0.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

